import React from 'react';
import {withRouter} from 'react-router-dom'

const Post = props => {
  const capitalize = (s) => {
    if (typeof s !== 'string') return ''
    return s.charAt(0).toUpperCase() + s.slice(1)
  }

  return (
    <div className={'Post'}>
      <h3>{props.title}</h3>
      <p>{props.body}</p>
    </div>
  )
}

export default Post
